import React from 'react';
import  "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import './Content.css';

export default function Content(){
    return(
        <>
        <div className="horizontal">
             <nav class="navbar navbar-light bg-light">
             <div class="container">
               <span>All Posts(32)</span> 
               <a href="#">Article</a>
               <a href="#">Event</a>
               <a href="#">Education</a>
               <a href="#">Job</a>
             </div>
            </nav>
       </div>
        </>
    )
}
